export const openEditTitleAction = (photo) => {
    console.log(photo)
    return({
        type: 'OPEN_EDIT_TITLE_ACTION',
        payload: photo
    })
}
export const closeEditPhotoAction = () => {
    return({
        type: 'CLOSE_EDIT_TITLE_ACTION'
    })
}
